-- 

CREATE TABLE `user_message_settings` (
  `user_id` bigint(20) NOT NULL,
  `use_signature` tinyint(4) NOT NULL default '1',
  `signature` text,
  `last_id` bigint(20) default '0' COMMENT 'last id unread is checked to filter',
  `sort_inbox` varchar(5) default NULL,
  `sort_outbox` varchar(5) default NULL,
  `sort_notice` varchar(5) default NULL,
  `page_range` int(11) NOT NULL default '25',
  `quick_display` tinyint(4) NOT NULL default '0',
  PRIMARY KEY  (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

